<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;楽天スーパーSALE&nbsp;&gt;&nbsp;SALE対象キャラクター

ムーミンのリュック。<br>
軽くて丈夫なポリエステル素材のリュックです。<br>
<br>
両手があくリュックはこの頃世代を問わず人気ですね。<br>
大人世代にも人気のムーミンキャラクターならなおさら！<br>
リトルミイ、ムーミン、コミック柄の3デザイン。<br>
<br>
表地はシンプルなデザインなので、年齢性別問わずお使いいただけます。<br>
それぞれのキャラクターがデザインされた前面左下の織ネームと<br>
ファスナー開閉時にチラっと見える総柄デザインの裏地がポイント。<br>
<br>
表地はリトルミイがブラック、ムーミンがネイビー、コミック柄がカーキです。<br>
<br>
メインルームはダブルファスナーで荷物の出し入れも楽々! <br>
<br>
小物を入れるのに便利な大きなポケットが外側に1つと、<br>
内側にフラットポケットが1つ付き、A4サイズが余裕で入るので、<br>
通学・通勤はもちろん、イベントやレジャーなどにもオススメです。<br>
<br>
サイズ・容量 <br>
約H40×W32×D15cm <br>
規格 <br>
■素材・成分：ポリエステル <br>
